var RNFS = require("react-native-fs");
const rootPath = RNFS.DocumentDirectoryPath;

export const parser = async language => {
  const text = await RNFS.readFile(
    `C:\Users\Michael Vamvakas\Desktop\GIT\op-street-cred\src\libs\HelloWorld/${language}.helloworld.txt`,
    "utf-8"
  );
  return text;
};
